import React from 'react';
import Nav from 'react-bootstrap/Nav';
import kitty from '../images/orange_cat.png';

export default function Navbar() {
    return (
        <>
            <Nav className="navbar" defaultActiveKey="/home" class="navbar navbar-expand-lg navbar-dark bg-dark">
                <img src={kitty} className="kitty" alt="logo orange cat image"/>

                <div className="github-container">
                    <link rel="stylesheet"
                          href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css"/>
                    <i className="fa fa-github"></i>
                    <Nav.Link className="github-link" href="https://github.com/ilgharr"
                              style={{color: "white"}}>GitHub</Nav.Link>
                </div>
                <div>
                    <Nav.Link href="https://leetcode.com/u/ilghar/" style={{color: "white"}}>Leet Code</Nav.Link>
                </div>

            </Nav>
        </>


    )
}
